import React from "react";
import ReactDOM from "react-dom";
import App from "./components/App"

function Beyonce_Top () {
	return <div className="card">
		<h2>Beyonce</h2>
		<img src = "https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" alt = "Beyonce's Image" />
	</div>
}

function Beyonce_Bottom () {
	return <div className="card">
		<p>+123 456 789</p>
		<p>b@beyonce.com</p>
	</div>
}

ReactDOM.render(<div>
    <Beyonce_Bottom/>
    <Beyonce_Top/>
</div>, document.getElementById("root"));

